To determine the oath of allegiance of the United States, we should consider the context in which it is taken. The oath of allegiance is typically taken by individuals who are becoming citizens of the United States, such as during a naturalization ceremony.

There are different oaths of allegiance that can be taken depending on the situation, but the most common one is the oath of renunciation and allegiance, which is specified by the Immigration and Nationality Act.

To find the exact oath, we need to refer to the law, which states:

"I hereby declare, on oath, that I absolutely and entirely renounce and abjure all allegiance and fidelity to any foreign prince, potentate, state or sovereignty, of whom or which I have heretofore been a subject or citizen;

That I will support the Constitution of the United States of America, and that I will obey the laws of the United States of America, and that I will bear true faith and allegiance to the same;

That I will bear arms on behalf of the United States when required by the law;

That I will perform noncombatant service in the Armed Forces of the United States when required by the law;

That I will perform work of national importance under civilian direction when required by the law;

That I will fulfill any millitary or civic duty, and that I take this obligation freely, without any mental reservation or purpose of evasion; so help me God."

Answer: The oath of allegiance of the United States is the one mentioned above

